using System;

// https://practice.geeksforgeeks.org/problems/string-formation-from-substring/0
namespace GeeksForGeeks_csharp
{
	public class String_formation_from_substring
	{
		public static bool solve(string s){

			int n = s.Length;

			int k = 0;

			// as long as pointer (k) goes inline with pointer (i), that means my string is repetitive, which indicates
			// the String can be formed by repeating a substring multiple times.
			for (int i = 1; i < n; ++i) {
				char c = s [i];
				char ck = s [k];

				if (c == ck) {
					// if a match, increment pointer k
					k++;
				} else {
					// if not match, reset k to the beginning and do one more check in case the repeition starts from
					// current value of i, if so increment k and the next for-loop tick will increment i to the next char
					k = 0;
					char ck2 = s [k];
					if (c == ck2) {
						k++;
					}
				}
			}

			// since "i" will reach the end before "k", compare the left over (tail) i.e. 
			// (substring from k to end) should equal to the start of string of same length, i.e. it should be repetitive
			// also check for exception rules: if string is only one character and if k==0 (k resets to zero when there
			// is no match, so k=0 means i never had a match for the entire string)
			return n!= 1 & k!= 0 && s.Substring(k) == s.Substring(0,n-k);
		}

		static void test(){
			bool result = solve ("");
			Console.WriteLine (result);
		}
	}
}

